  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Malheur Migratory
  Waterfowl Refuge outlines Refuge accomplishments from fiscal year 1940. The report
  begins by summarizing the water conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, and predators- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, and Refuge participation. Photographs are attached.\",\n\t\"license_title\":
